import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';

@Component({
  selector: 'app-room-dashboard',
  templateUrl: './room-dashboard.page.html',
  styleUrls: ['./room-dashboard.page.scss'],
})
export class RoomDashboardPage implements OnInit {

  constructor(private router: Router) { }

  ngOnInit() {
  }

  goBack() {
    this.router.navigate(['/room-selection']);
  }

}
<ion-header>
  <ion-toolbar>
    <ion-buttons slot="start">
      <ion-back-button></ion-back-button>
    </ion-buttons>
    <ion-title>Room Dashboard</ion-title>
  </ion-toolbar>
</ion-header>

<ion-content class="room-dashboard-content">
  <div class="room-dashboard-container">
    <h1>Room Dashboard</h1>
    <p>This page will show your room dashboard with letters and stats.</p>
    <ion-button (click)="goBack()">Go Back</ion-button>
  </div>
</ion-content>
